import React from 'react';
import './wishlist.css';
import { useLocation } from 'react-router-dom';

const Wishlist = () => {
    const location = useLocation();
    const searchResults = location.state?.searchResults || [];

    return (
        <div>
            <div className='temp-palelime-bg'>
                <div>
                    <h1>HELLO.</h1>
                    {searchResults.map()}
                </div>
            </div>
        </div>
    )
}

export default Wishlist;
